import React, { useState } from "react";
function App() {
  const [state, setState] = useState({ firstName: "John", lastName: "Doe" });
  return (
    <div>
      <p>
        My name is {state.firstName} {state.lastName}
      </p>
      <button Click={() => setState({ ...state, firstName: "Jane" })}>
        Change Name
      </button>
    </div>
  );
}
export default App;
